import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import serviceImg from '../src/serviceImg.svg';
import one from '../src/one.svg';
import two from '../src/two.svg';
import three from '../src/three.svg';
import four from '../src/four.svg';


function Processsteps() {
  return (
    <Container maxWidth="xl" style={{ position: "relative", width: "100%"}}>
     <Grid container spacing = {6} alignContent="flex-start" justifyContent="center" style = {{fontSize: 25, fontFamily:'josefin sans', alignItems: "center", position: "fixed"}}>
     <Grid item xs={1}>
     <img src = {one} height = "80px" width = "80px"/>
  </Grid>
  <Grid item xs={11}>
    <p>Requirement Gathering: Initial focus on collecting necessary information on the business, founder, and project. This includes an initial meeting and client intake form. Here is where the scope of work is defined. </p>
  </Grid>
  <Grid item xs={1}>
  <img src = {two}  height = "80px" width = "80px"/>
  </Grid>
  <Grid item xs={11}>
    <p>Prototyping: Development of proposal and initial draft of deliverables. Clients can get a feel on the quality of provided work. </p>
  </Grid>
  <Grid item xs={1}>
  <img src = {three}  height = "80px" width = "80px"/>
  </Grid>
  <Grid item xs={11}>
    <p>Creation & Delivery: Project is developed and delivered for clients. Clients can provide their feedback and ask for edits. There is no set number of revisions; the focus is on revising until the client is happy. </p>
  </Grid>
  <Grid item xs={1}>
  <img src = {four}  height = "80px" width = "80px"/>
  </Grid>
  <Grid item xs={11}>
    <p>Next Steps & FAQ: Clients can ask questions regarding the deliverables and determine if any next steps are necessary. </p>
  </Grid>
        </Grid>
    </Container>
  )
}

export default Processsteps;
